"use strict";function __user_getLists(){$.ajax({url:Global.API_URL+"/accesscontrol/appuser/list",type:"GET",async:!0,dataType:"json",cache:!0,beforeSend:function(e){e.setRequestHeader("Authorization","Bearer "+localStorage.getItem("Token"))},error:function(e,t,a){},complete:function(e){var t=[],a=1;for(var s in e.responseJSON)if(e.responseJSON.hasOwnProperty(s)){var o=e.responseJSON[s],l="<tr><th>"+a+'</th><td><a href="/getuser?id='+checkNull(o.UserId)+'">'+checkNull(o.FullName)+"</a></td><td>"+checkNull(o.Email)+"</td><td>"+checkNull(o.UserName)+"</td></tr>";t.push(l),a++}$(".userlists").html('<table class="table-md table-striped table-hover"><thead> <tr> <th scope="col">#</th> <th scope="col">Họ và tên</th> <th scope="col">Email</th> <th scope="col">Username</th> </tr></thead><tbody></tbody></table>'),$("#pagination").pagination({dataSource:t,pageSize:5,ulClassName:"pagination",showPrevious:!1,showNext:!1,callback:function(e,t){var a=e;$(".userlists table tbody").html(a),$("#pagination li").each(function(){$(this).addClass("page-item").find("a").addClass("page-link")})}})}})}$(document).ready(function(){__user_getLists()});